import RCompThumbnail from "../../assets/img/compositions/static.png";
import RCompPreview from "../../assets/img/compositions/dynamic.gif";

export const initialState = {
    pageTitle: 'compositions',
    compositions: [
        {
            id: 0,
            title: 'Lespo',
            typeVariant: 0,
            price: 3.43,
            thumbnail: RCompThumbnail,
            preview: RCompPreview,
            badges: [
                
            ],
            inputs: {
                username: {
                    value: "qweik"
                },
                twitch: {
                    value: "twitch.tv/qweik"
                }
            }
        }, {
            id: 1,
            title: 'Newzo',
            typeVariant: 1,
            price: 2.43,
            thumbnail: RCompThumbnail,
            preview: RCompPreview,
            inputs: {
                username: {
                    value: "qweik"
                },
                twitch: {
                    value: "twitch.tv/qweik"
                }
            }
        }, {
            id: 2,
            title: 'Winter',
            typeVariant: 2,
            price: 412.43,
            thumbnail: RCompThumbnail,
            preview: RCompPreview,
            inputs: {
                username: {
                    value: "qweik"
                },
                twitch: {
                    value: "twitch.tv/qweik"
                }
            }
        },
    ],
}

export function compositionsReducer(state = initialState, action) {
    switch (action.type) {
        case '':
            return {...state,}

        default:
            return state
    }
}
